import React, { Component } from 'react';
import Table from 'react-bootstrap/Table';

class TableView extends React.Component{

    render(){
        return(
            <Table responsive xs lg="2" >
                <thead>
                    <tr>
                    <th>Table heading</th>
                    <th>Table heading</th>
                    </tr>
                </thead>
                <tbody>
                    <tr>
                    <td>Table cell</td>
                    <td>Table cell</td>
                    </tr>
                    <tr>
                    <td>Table cell</td>
                    <td>Table cell</td>
                    </tr>
                    <tr>
                    <td>Table cell</td>
                    <td>Table cell</td>
                    </tr>
                </tbody>
            </Table>
        );
    }

}
export default TableView;
